function ListTrending() {
  return (
    <div className="movieTrending" >
      <p>Bảng xếp hạng</p>
      - - - - - - - - - - - - - - - - - - - - - - - - - - - - -
      <div class="movieTrending_grid">
        <div class="box">A</div>
        <div class="box">B</div>
      </div>
    </div>
  );
}

export default ListTrending;
